import React from "react";
import Header from "./Header";
export default function Industries() {
  return (
    <>
      <div>
        <Header />
      </div>
      <div>
        <h5>Sumago Infotech</h5>
        <div className="d-flex justify-content-center"> 
          <hr className="w-25" style={{ backgroundColor: "white" }} />
        </div>
        <div>
            <h4>...Our Company Expertise...</h4>
        </div>
      </div>
    </>
  );
}
